import Input from '@material-ui/core/TextField';
import { Container } from '@material-ui/core';
import Typography from '@material-ui/core/Typography';

const styleInput = {
    height: '100px',
    width: '25ch'
};
const styleBack = {
    margin: '10px',
    background: '#ccc',
    height: '300px',
    width: '30ch'

}

const Login = () =>{
    return(
        <Container borderRadius={160}>
            <Typography component="div" style={styleBack}/>
            <form style={styleInput}>
                <Input placeholder="YourEmail@mail.com" inputProps={{ 'aria-label': 'description' }} />
            </form>
        </Container>

    )
}

export default Login;
